import React from "react";
import { StyleSheet, Image, View, Text } from 'react-native';
import TextCenter from "../components/TextCenter";


const Home = (props) => {
  return (
    <View>
      <TextCenter text="InfoTec" />
      <Text>
        Hello
      </Text>
    </View>
  );
};

const navbar = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  }
});

export default Home;
